import React, { Component } from "react";
import "./sportsEquipment.css";



class SportsEquipment extends Component {
  render() {
    return (
      <div className="SportsEquipment">
        <h1 className="pTitle">Alquiler de elementos deportivos</h1>        
       <div class="dropdown">
        <button class="dropbtn">- seleccione un elemento -</button>
        <div class="dropdown-content">

            <a>{this.props.name}</a>
            
        </div>
        
</div>     
      </div>
    );
  }
}

export default SportsEquipment;
